    <div className="header">
      <nav class="navbar navbar-dark bg-dark">
        <a class="navbar-brand">
          Navbar w/ text
        </a>
        <span class="navbar-text">Level = {currentLevel} Score = {currentScore} Best Score = {bestScore}</span>
        {codeIsActivated && <span class="navbar-text">Level = {currentLevel} Score = {currentScore} Best Score = {bestScore}</span>}
      </nav>
    </div>
  );
};

export default Header;
